import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { PresupuestoService } from 'src/app/services/presupuesto.service';

@Component({
  selector: 'app-gastos',
  templateUrl: './gastos.component.html',
  styleUrls: ['./gastos.component.css']
})
export class GastosComponent implements OnInit{

  constructor(private _presupuestoService: PresupuestoService, private router:Router){}

  ngOnInit(): void {
    if(this._presupuestoService.presupuesto === 0){
      this.router.navigate(['/ingresarPresupuesto']);
    }
    console.log(this._presupuestoService.presupuesto);
  }
}
<div class="containera p-5">
  <h2 class="text-center">Ingrese presupuesto</h2>
  <div class="card">
    <div class="card-body">
      <div class="row">
        <div class="col-lg-6">
          <app-ingresar-gasto></app-ingresar-gasto>
        </div>
        <div class="col-lg-6">
          <app-listar-gasto></app-listar-gasto>
        </div>
      </div>
    </div>
  </div>
</div>
